import { useState, useEffect } from "react";
import { useHistory } from "react-router-dom";
import ShowAllRecipes from "../sections/ShowAllRecipes";
const { getData, getUserRecipes } = require('../DAL/api')


function Profile() {

    const [isLoged, setIsLoged] = useState(false)
    const [recipes, setRecipes] = useState([])
    const [images, setImages] = useState([])


    useEffect(async () => {
        const fetchImages = await getData('images')
        const a = localStorage.getItem('user')
        console.log(a);
        if (a) setIsLoged(true)
        setImages(fetchImages)
        const fetchRecipes = await getData('recipes')
        setRecipes(fetchRecipes)

    }, [])

    if (!isLoged) {
        useHistory.push('/login')
    }
    return (

        isLoged && <ShowAllRecipes recipes={recipes} images={images} />
    )
}
export default Profile
